/* eslint-disable no-console */
/* eslint-disable react/prop-types */
/* eslint-disable react/jsx-curly-brace-presence */
import React from 'react';
import { connect, useDispatch } from 'react-redux';
import { useHistory } from 'react-router-dom';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import GoogleLogin from 'react-google-login';
import Copyright from '../../components/CopyRight';
import background from '../../Assets/bg-login.jpg';
import * as actions from '../../Redux/Actions/login';

const useStyles = makeStyles((theme) => ({
  root: {
    height: '100vh',
  },
  image: {
    backgroundImage: `url(${background})`,
    backgroundRepeat: 'no-repeat',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    alignItems: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    paddingTop: '250px',
  },
  Copyright: {
    paddingTop: '600px',
    textAlign: 'center',
  },
}));

const Login = ({ profile }) => {
  const classes = useStyles();
  const history = useHistory();

  const dispatch = useDispatch();

  const responseGoogle = (response) => {
    if (response) {
      dispatch(actions.setProfile({ response }));
      console.log('setting localstorage', response.accessToken);
      localStorage.setItem('token', response.accessToken);
      console.log('profile=', profile);
    }
  };

  return (
    <Grid container component="main" className={classes.root}>
      <Grid item xs={12} sm={6} md={6} className={classes.image}>
        <div style={{
          position: 'absolute', top: '45%', left: '15%', fontSize: '40px',
        }}
        >
          Sign In to View Contacts!!
        </div>
      </Grid>
      <Grid item xs={12} sm={6} md={6} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <GoogleLogin
            clientId="401304201266-td9jpef3003b3uqjekoip3m5hmog57u9.apps.googleusercontent.com"
            buttonText="Sign In using Google"
            onSuccess={responseGoogle}
            onFailure={responseGoogle}
            cookiePolicy={'single_host_origin'}
          />
          <br />
          <Copyright />
        </div>
      </Grid>
    </Grid>
  );
};

const mapStateToProps = (state) => ({ profile: state.profile });

export default connect(mapStateToProps)(Login);

